import React from 'react';
import classes from './Head.module.css'
let data_1 = [
    {
        li_name: "ресив",
        ul_notis: ["123", "111", "222"],
        model: [11, 22, 33, 44, 55],
    },
    {
        li_name: "каналы",
        ul_notis: [],
        model: [],
    },
    {
        li_name: "каналы",
        ul_notis: ["123", "111", "222", "222", "222"],
        model: [4, 55],
    },
    {
        li_name: "баги",
        ul_notis: ["123"],
        model: [11, 22, 33, 44, 55],
    },
    {
        li_name: "заказы",
        ul_notis: ["133", "111", "222"],
        model: [],
    },
    {
        li_name: "IT",
        ul_notis: [],
        model: [115],
    },
]

const Ul_li = data_1.map((el, index) =>
    <ul>
        <li className="ul_1"><a>{el.li_name}</a>
            <ul>
                <li className="ul_2">{el.ul_notis[0]}{el.ul_notis[1]}{el.ul_notis[2]}{el.ul_notis[3]}
                    <ul>
                        <li className="ul_3">
                            <a>{el.model}</a>
                        </li>
                    </ul>
                </li>    
            </ul>
        </li>
    </ul>
)



const Head_ul = () => {
    return (
        <div>
            {Ul_li}
        </div>
    )
}
export default Head_ul;










